Перед созданием задачи, компилятор выделяет большое фиксированное кол-во памяти. Вместе с этим устанавливаются внутренние флаги, записи о дочерних задачах и контекст. Инициализация задачи и её прикрепление к родительской задачи. Приостановка и возобновление. Сама по себе async let не является точкой приостановки, но при обращение к async let задаче с помощью ключевого слова await, текущая задача приостанавливает свое выполнение и сохраняет состояние. Обработка ошибок. Задача может вернуть ошибку вместо результата. Отмена задачи при выходе из области видимости. Удаление записей о дочерних задачах. Освобождение памяти для дочерних задач и самой async let задачи. При создании задачи с помощью async let компилятор определяет является ли она структурированной или не структурированной с помощью вспомогательных методов: static inline bool taskIsStructured(JobFlags jobFlags) { return jobFlags.task_isAsyncLetTask() || jobFlags.task_isGroupChildTask();
} static inline bool taskIsUnstructured(TaskCreateFlags createFlags, JobFlags jobFlags) { return !taskIsStructured(jobFlags) && !createFlags.isInlineTask();
} static inline bool taskIsDetached(TaskCreateFlags createFlags, JobFlags jobFlags) { return taskIsUnstructured(createFlags, jobFlags) && !createFlags.copyTaskLocals();
}

