Для начала, каждая задача имеет четыре состояния. За состояние (статус) отвечает класс TaskStatusRecord: Suspended: приостановлена и не выполняется Enqueued: ожидает выполнения Running: выполняется Completed: выполнена За переключение состояний отвечают четыре метода. Возможны следующие переходы из одного состояния в другое: // suspended -> enqueued
// suspended -> running
// enqueued -> running
// running -> suspended
// running -> completed
// running -> enqueued Схематично: ---
