flowchart LR S((Suspended)) -- В ожидание --&gt; E((Enqueued)) S((Suspended)) -- Выполнение без ожидания --&gt; R((Running)) E -- Выполнение после ожидания --&gt; R Run((Running)) -- Задача приостанавливается --&gt; Sus((Suspended)) Run -- В ожидание --&gt; Enq((Enqueued)) Run -- Выполнение завершилось --&gt; C((Completed))
